import React, { useState, useEffect } from 'react';
import axios from 'axios';
function ShowAppointment() {
  const staticDoctors = [
    {
      "Name": "Ahmed",
      "speciality": "dentist",
      "Day1": "sunday",
      "Start1": "1:00",
      "end1": "2:00"
    },
    {
      "Name": "Ahmed",
      "speciality": "dentist",
      "Day1": "monday",
      "Start1": "2:00",
      "end1": "3:00"
    },
    {
      "Name": "osama",
      "speciality": "dentist",
      "Day1": "monday",
      "Start1": "2:00",
      "end1": "3:00"
    },
  ];

  const [doctors, setDoctors] = useState([]);

  useEffect(async () => {
     // Assuming data.json is in the public folder
      try {
      const response = await fetch('/data.json');

      if (!response.ok) {
        throw new Error(`Failed to fetch data (status: ${response.status})`);
      }

      const result = await response.json();
      console.log('Fetched Data:', result);
      setdoctors(result);
    } catch (error) {
      console.error('Error fetching data:', error.message);
    }});

  return (
    <div className='assign'>
      <u>
        <p className='home-logout'>
          <a href='/SignInPage'>logout</a>
        </p>
      </u>
      <u>
        <p className='home-logout'>
          <a href='/'>Home</a>
        </p>
      </u>
      <h1 className='header2'>Appointments</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Speciality</th>
            <th>Day</th>
            <th>Start Time</th>
            <th>End Time</th>
          </tr>
        </thead>
        <tbody>
          {doctors.map((doctor, index) => {
            // Use an if statement to conditionally render appointments with the name "osama"
            if (doctor.Name.toLowerCase() === 'osama') {
              return (
                <tr key={index}>
                  <td>{doctor.Name}</td>
                  <td>{doctor.speciality}</td>
                  <td>{doctor.Day1}</td>
                  <td>{doctor.Start1}</td>
                  <td>{doctor.end1}</td>
                </tr>
              );
            } else {
              return null;
            }
          })}
        </tbody>
      </table>
      <button>
        <a href='/ChooseDoc'>Back</a>
      </button>
    </div>
  );
}

export default ShowAppointment;
